import React, { Component } from 'react'

import './index.css'

export default class Square extends Component {
    constructor(props){
        super(props);
        this.state={
            value:null
        }
    }
    render() {
        const { value,onClick } = this.props
        return (
            <button className="square" onClick={() => {
                onClick();
            }}>
              {value}
            </button>
          );
    }
}
